import React from "react";

function PaintCard(props) {
    return (
        <>
        <div className="container">
            <div className="text-center text-primary"> Most Purchase Painting </div>
        <div className="cards">
            <div className="card">
                <img src="https://storage.googleapis.com/ehimages/2017/10/25/img_942b5703ed4c5d3b242a34f7cc87d9c0_1508933938684_processed_original.jpg" alt="mypic" className="card_img" />
                <div className="card_info">
                    <span className="card_category"> Category  </span>
                    <h3 className="car_title"> Title </h3>
                    <a href="https://storage.googleapis.com/ehimages/2017/10/25/img_942b5703ed4c5d3b242a34f7cc87d9c0_1508933938684_processed_original.jpg" target="_blank" >
                        <button>Order Now</button>
                    </a>
                </div>
            </div>
        </div>
        </div>
        </>
    );
}

export default PaintCard;
